Actionscript.script:
if(_parent.hp <= 0)
{
   if(_parent.已加经验值 != true)
   {
      _parent.击倒呐喊();
   }
   _parent.无敌 = true;
   _parent.防止无限飞 = true;
   stop();
   if(_parent._name == _root.控制目标)
   {
      _root.复活币系统界面.是否复活初始化();
      _root.关卡结束界面.mytext = "你受了重伤……";
      _root.关卡结束界面._visible = 1;
   }
   if(_parent.用户ID != undefined && _parent.已删除 != true)
   {
      var haveBing1 = false;
      var ss;
      g = 0;
      while(g < _root.同伴数)
      {
         if(_root.同伴数据[g][2] == _parent.用户ID)
         {
            haveBing1 = true;
            ss = g;
         }
         g++;
      }
      if(haveBing1)
      {
         _root.佣兵是否出战信息[_parent.佣兵是否出战信息id] = -1;
         _root.佣兵信息界面.排列佣兵图标();
         _root.add2map2(_parent,2);
         _parent.removeMovieClip();
      }
      _parent.已删除 = true;
   }
   if(_parent.已加经验值 != true)
   {
      if(_parent.是否为敌人 == true)
      {
         _parent.掉落装备();
         _root.敌人死亡计数 = _root.敌人死亡计数 + 1;
		 if(_parent.产生源 != undefined and _parent.是否为敌人 == true)
		 {
			if(_parent.hp <= 0)
			{
      			_root.gameworld[_parent.产生源].僵尸型敌人场上实际人数--;
      			_root.gameworld[_parent.产生源].僵尸型敌人总个数--;
			}
		 }
         _parent.计算经验值();
         _parent.人物文字信息._visible = 0;
         _root.add2map2(_parent,2);
         _parent.removeMovieClip();
      }
   }
}

if(_parent.hp <= 0)
{
   stop();
}
if(_parent.hp <= 0)
{
   stop();
}
if(_parent.hp == 0)
{
   stop();
}
if(_parent.hp < 0)
{
   stop();
}

